// /src/pages/HomePage/CallToAction.js
import React from "react";
import "../../styles/HomePage/CallToAction.css";

const CallToAction = () => {
  return (
    <section className="cta-section">
      <div className="cta-content">
        <h2>Ready to take charge of your health?</h2>
        <p>Join thousands of others and access affordable healthcare instantly.</p>
        <button className="primary-btn">Join AyuRaksha</button>
      </div>
    </section>
  );
};

export default CallToAction;
